import React from 'react';
import styled from 'styled-components';

const TodoList = () => {
	return <Wrapper>TodoList</Wrapper>;
};

const Wrapper = styled.div`
	flex: 1;
	padding: 20px 32px;
	padding-bottom: 48px;
	overflow-y: auto;
	background: gray;
`;

export default TodoList;
